webpackJsonp([0xd73a11d904022800],{"./node_modules/json-loader/index.js!./.cache/json/miscellaneous-checkout-a-remote-branch-in-git.json":function(e,o){e.exports={data:{markdownRemark:{html:'<h1>Checkout a remote branch workflow</h1>\n<p>Depending on how many remotes are present for your local repo, follow the appropriate flow.</p>\n<h2>For repos with one remote:</h2>\n<p>If your local repo is having just one remote for example just <code>origin</code>:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>git remote -v\norigin  https://github.com/my_username/AwesomeRepo.git (fetch)\norigin  https://github.com/my_username/AwesomeRepo.git (push)</code></pre>\n      </div>\n<p>Then you can simply do:  </p>\n<p><code>git fetch</code>  </p>\n<p><code>git checkout some_branch_name</code></p>\n<h2>For repos with multiple remote:</h2>\n<p>If your local repo is having multiple remotes:</p>\n<div class="gatsby-highlight">\n      <pre class="language-none"><code>git remote -v\norigin      https://github.com/raisedadead/wiki.git (fetch)\norigin      https://github.com/raisedadead/wiki.git (push)\nupstream    https://github.com/FreeCodeCamp/wiki.git (fetch)\nupstream    https://github.com/FreeCodeCamp/wiki.git (push)</code></pre>\n      </div>\n<p>Then you have to specify a remote as well:<br>\n<code>git fetch</code><br>\n<code>git checkout -b some_branch_name &#x3C;remote>/some_branch_name</code><br>\nwhere <code>&#x3C;remote></code> in this example is either <code>upstream</code> or <code>origin</code>.</p>',fields:{slug:"/miscellaneous/checkout-a-remote-branch-in-git/"},frontmatter:{title:"Checkout a Remote Branch in Git"}}},pathContext:{slug:"/miscellaneous/checkout-a-remote-branch-in-git/"}}}});
